import React from 'react';
import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state={
      title: 'React Simle Crud Aplicaton'
    }
  }

  render() {
    return (
      <div className="App">
      <h2>{this.state.title}</h2>
      </div>
    );
  }
}


export default App;
